import{_ as r,E as o,c as s,J as n,a4 as t,o as i,aM as h,aN as l,aO as e,aP as c,aQ as g,aR as d,aS as m}from"./chunks/framework.BCdQCdRN.js";const I=JSON.parse('{"title":"Form Error Response","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/form-response/form-error-response.md","filePath":"documentation/form-response/form-error-response.md","lastUpdated":1702477588000}'),p={name:"documentation/form-response/form-error-response.md"},u=t('<h1 id="form-error-response" tabindex="-1">Form Error Response <a class="header-anchor" href="#form-error-response" aria-label="Permalink to &quot;Form Error Response&quot;">​</a></h1><p>Through this option, you can match the error response (returned from server), when entry is not submitted, When It matches with given error response, entry will be marked as <strong>Entry Saved</strong> and You can also set the <a href="#action">action</a>.</p><img src="'+h+'" width="400" height="400" alt="Form Error Response"><h2 id="options" tabindex="-1">Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;Options&quot;">​</a></h2><table><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td><a href="#error-page-url">Error Page URL</a></td><td>The URL of the page on which the entry error message appears.</td></tr><tr><td><a href="#match-url-types">Match URL Types</a></td><td>What is the type of Error Page URL given above is given in this.</td></tr><tr><td><a href="#error-response-type">Error Response Type</a></td><td>The type of error message appears on the page is given in this option.</td></tr><tr><td><a href="#enter-error-message">Enter Error Message</a></td><td>The error message that comes after the entry is saved is given.</td></tr><tr><td><a href="#delay-time-before-run-action">Delay Time Before Run Action</a></td><td>Time delay before the <a href="#action">action</a> is executed.</td></tr><tr><td><a href="#action">Action</a></td><td>If the given <a href="#error-response-type">Error Response Type</a> matches, then this action is executed.</td></tr></tbody></table><h2 id="additional-options" tabindex="-1">Additional Options <a class="header-anchor" href="#additional-options" aria-label="Permalink to &quot;Additional Options&quot;">​</a></h2><table><thead><tr><th>Option</th><th>Description</th></tr></thead><tbody><tr><td>If excel data is not found then don&#39;t execute the action</td><td>Even if there is no data in Excel, the <a href="#action">action</a> is still executing, then you can turn it off with this option.</td></tr><tr><td>If last excel entry completed then don&#39;t execute the action</td><td>If the last entry of excel has been saved and you do not want the <a href="#action">action</a> not to be executed after the last entry, then you can do it by turning on this option.</td></tr><tr><td>If there is no Excel data, update only scraper data in Excel</td><td>If you are <a href="/documentation/form-fields/field-types.html#scraper-data">scraping data</a> from the site and you are not using Excel template in the extension, then the data being scraped from that option will be saved in the extension.</td></tr><tr><td>Can error message be anything in this element</td><td>If the error message of the entry is always changing then using this option matches <strong>any type of message</strong> in the given element.</td></tr></tbody></table><h2 id="error-page-url" tabindex="-1">Error Page URL <a class="header-anchor" href="#error-page-url" aria-label="Permalink to &quot;Error Page URL&quot;">​</a></h2><p>Fill in the URL of the page on which you want to match the error response.</p><h2 id="match-url-types" tabindex="-1">Match URL Types <a class="header-anchor" href="#match-url-types" aria-label="Permalink to &quot;Match URL Types&quot;">​</a></h2><p>How you want to match with <a href="#error-page-url">Error Page URL</a></p><ul><li>Match with Full URL</li><li>Match with URL <a href="https://developer.mozilla.org/en-US/docs/Web/API/URL/pathname" target="_blank" rel="noreferrer">pathname</a></li><li>Match with URL <a href="https://developer.mozilla.org/en-US/docs/Web/API/URL/hostname" target="_blank" rel="noreferrer">hostname</a></li><li>Match with RegEx</li></ul><h2 id="error-response-type" tabindex="-1">Error Response Type <a class="header-anchor" href="#error-response-type" aria-label="Permalink to &quot;Error Response Type&quot;">​</a></h2><p>It is about, How server returns Error Response to User.</p><ol><li><a href="#matching-message-in-page">Matching Message In Page</a></li><li><a href="#matching-message-in-alert-message">Matching Message In Browser Alert</a></li><li><a href="#matching-message-in-page-element-value">Matching Message In Page Element Value</a></li><li><a href="#checking-element-exists-in-page">Checking Element Exists In Page</a></li><li><a href="#matching-error-page-url">Matching Error Page URL</a></li></ol><h3 id="matching-message-in-page" tabindex="-1">Matching Message In Page <a class="header-anchor" href="#matching-message-in-page" aria-label="Permalink to &quot;Matching Message In Page&quot;">​</a></h3><p>If the error message is visible in the page after the entry is saved, then you can choose that option. Message can be like this. The text of this message is given in the <a href="#enter-error-message">Enter Error Message</a> option.</p><img src="'+l+'" alt="Form Error Response"><p>You can also give the address of the element of error message. By default error message is searched in the entire page. If you want the Error Message to be searched only in the element given by you, then you can give the Selector Query of that message in the <em>Message Selector Query</em> Field.</p><img src="'+e+'" width="500" height="500" alt="Image"><h3 id="matching-message-in-alert-message" tabindex="-1">Matching Message In Alert Message <a class="header-anchor" href="#matching-message-in-alert-message" aria-label="Permalink to &quot;Matching Message In Alert Message&quot;">​</a></h3><p>If the response of the entry comes in the form of <strong>javascript dialog</strong> (Browser Alert), you can hide the dialog from <a href="/documentation/extension.html#hide-javascript-dialog">extension settings</a> and fetch the response to match against given <a href="#enter-error-message">Enter Error Message</a>.</p><img src="'+c+'" alt="Alert Dialog"><h3 id="matching-message-in-page-element-value" tabindex="-1">Matching Message In Page Element Value <a class="header-anchor" href="#matching-message-in-page-element-value" aria-label="Permalink to &quot;Matching Message In Page Element Value&quot;">​</a></h3><p>If the Error Message appears in the page itself but in the Form Field (<strong>InputBox</strong>), then you can use it. The message has to be given in <a href="#enter-error-message">Enter Error Message</a> and the selector query of that field is given in the option given below.</p><img src="'+e+'" width="500" height="500" alt="Image"><h3 id="checking-element-exists-in-page" tabindex="-1">Checking Element Exists In Page <a class="header-anchor" href="#checking-element-exists-in-page" aria-label="Permalink to &quot;Checking Element Exists In Page&quot;">​</a></h3><p>If you want to check only the element in the page then you can use this option. But keep in mind that element should not already be present in the page and should come only after the entry is saved. Selector query of that element is given in the option given below.</p><img src="'+e+'" width="500" height="500" alt="Image"><h3 id="matching-error-page-url" tabindex="-1">Matching Error Page URL <a class="header-anchor" href="#matching-error-page-url" aria-label="Permalink to &quot;Matching Error Page URL&quot;">​</a></h3><p>If you only want to check that the <a href="#error-page-url">Error Page URL</a> given by you matches only this, then you can use this option. But keep in mind that both the entry page URL and the error page URL should be different.</p><h2 id="enter-error-message" tabindex="-1">Enter Error Message <a class="header-anchor" href="#enter-error-message" aria-label="Permalink to &quot;Enter Error Message&quot;">​</a></h2><p>If Server returns something back to user after form is successfully submitted, Then you can use it along with <strong>Error Response Type</strong> to check If form is really saved.</p><p>Here you can have multiple messages. If any of the given messages is matched, then the extension will mark the current entry as <strong>saved</strong> and after that, it will execute the <a href="#action">Action</a> given by you.</p><p>Example:</p><img src="'+g+'" alt="Form Error Response"><details class="details custom-block"><summary>Will the error message be checked across the page?</summary><p><strong>Yes</strong>. By Default error messages are checked across the page. With <strong>Message Selector Query</strong> Option, you can give selector query of any element of the page, and <strong>error messages</strong> will only be checked in that selector query scope.</p><img src="'+d+'" alt="Form Error Response"><br></details><details class="details custom-block"><summary>Will the entry be filled, if the error message is already present in the page?</summary><p>If any error message is present in the page <strong>before</strong> submitting the form, then the extension will have a match against the given <strong>error messages</strong> before the entry and the <strong>entry will not be filled</strong>.</p></details><details class="details custom-block"><summary>How to fill dynamic error message?</summary><p>If server response is dynamic or changes every time or It has some data from any column from excel, then you can use variable like this.</p><img src="'+m+'" alt="Entry Response"><p>Apart from this, if you only give <strong>&quot;OTP number send to this mobile&quot;</strong> in the error message, it will also work.</p></details><h2 id="entry-action-type" tabindex="-1">Entry Action Type <a class="header-anchor" href="#entry-action-type" aria-label="Permalink to &quot;Entry Action Type&quot;">​</a></h2><p>You can set whether to stop the entry after the <a href="#error-response-type">Error Response Type</a> matches or whether to save the error message in the entry.</p><ol><li>Stop Entry</li><li>Save Error in the Entry Data</li></ol><h2 id="delay-time-before-run-action" tabindex="-1">Delay Time Before Run Action <a class="header-anchor" href="#delay-time-before-run-action" aria-label="Permalink to &quot;Delay Time Before Run Action&quot;">​</a></h2><p>Time delay before the <a href="#action">action</a> is executed. Set time in the Milliseconds.</p>',44),f=t('<h2 id="action" tabindex="-1">Action <a class="header-anchor" href="#action" aria-label="Permalink to &quot;Action&quot;">​</a></h2><p>If the given <a href="#error-response-type">Error Response Type</a> matches, then this action is executed.</p><ul><li>Redirect to Page</li><li>Re-Execute Form</li><li>Click on Button</li><li>Page Reload</li><li>Execute Segment</li></ul>',3);function y(b,E,_,v,x,R){const a=o("Badge");return i(),s("div",null,[u,n(a,{type:"tip",text:"1 seconds = 1000 milliseconds"}),f])}const k=r(p,[["render",y]]);export{I as __pageData,k as default};
